-- ----------------------------
-- Table structure for base_node
-- ----------------------------
DROP TABLE IF EXISTS `base_node`;
CREATE TABLE `base_node` (
`nodeId`  bigint(20) UNSIGNED NOT NULL AUTO_INCREMENT COMMENT '这是一个唯一的标识，并且和其他类型表的nodeid一致，一个总表，可以提供一些基本的信息。' ,
`longitude`  decimal(14,10) NULL DEFAULT NULL COMMENT '经度' ,
`latitude`  decimal(14,10) NULL DEFAULT NULL ,
`location`  char(1) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '方位，提供八个方向。' ,
`collectTime`  datetime NULL DEFAULT NULL COMMENT '收集点位的时间' ,
`description`  varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '点位的描述' ,
`nodeName`  varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL ,
`tableId`  int(11) NULL DEFAULT NULL ,
`address`  varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '详细的地址' ,
`userId`  int(11) NULL DEFAULT NULL ,
`nodeType`  char(1) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '1' COMMENT '点位类型，1基础点，2案件点，3案件中心点' ,
`isValid`  char(1) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '是否有效' ,
PRIMARY KEY (`nodeId`),
FOREIGN KEY (`userId`) REFERENCES `user` (`Id`) ON DELETE RESTRICT ON UPDATE RESTRICT,
FOREIGN KEY (`tableId`) REFERENCES `table_type` (`id`) ON DELETE RESTRICT ON UPDATE RESTRICT,
INDEX `userId` (`userId`) USING BTREE ,
INDEX `nodeClassfyId` (`tableId`) USING BTREE
)
ENGINE=InnoDB
DEFAULT CHARACTER SET=utf8 COLLATE=utf8_general_ci
AUTO_INCREMENT=3

;

