`description`  varchar(128) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '' COMMENT '案件描述' ,
`groupId`  int(11) NULL DEFAULT NULL COMMENT '属于哪个成员组的' ,
