-- ----------------------------
-- Table structure for case_node
-- ----------------------------
DROP TABLE IF EXISTS `case_node`;
CREATE TABLE `case_node` (
`Id`  int(11) NOT NULL AUTO_INCREMENT COMMENT '案件点位id' ,
`nodeId`  bigint(20) UNSIGNED NULL DEFAULT NULL ,
`record`  varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '研判记录' ,
`caseId`  int(11) NULL DEFAULT NULL COMMENT '关联到哪个案件，一般没有立案时不会和案件相关联的' ,
`alarmId`  int(11) NULL DEFAULT NULL COMMENT '接警处编号' ,
`baseNodeId`  bigint(20) UNSIGNED NULL DEFAULT NULL COMMENT '反映的是否来自基础点位的标识' ,
