FOREIGN KEY (`caseId`) REFERENCES `case` (`Id`) ON DELETE RESTRICT ON UPDATE RESTRICT,
FOREIGN KEY (`nodeId`) REFERENCES `base_node` (`nodeId`) ON DELETE RESTRICT ON UPDATE RESTRICT,
FOREIGN KEY (`baseNodeId`) REFERENCES `base_node` (`nodeId`) ON DELETE RESTRICT ON UPDATE RESTRICT,
INDEX `caseId` (`caseId`) USING BTREE ,
INDEX `nodeId` (`nodeId`) USING BTREE ,
INDEX `baseNodeId` (`baseNodeId`) USING BTREE
)
ENGINE=InnoDB
DEFAULT CHARACTER SET=utf8 COLLATE=utf8_general_ci
AUTO_INCREMENT=1

;

